import React from 'react'

function Main() {
  return (
    <>
    <div className='100-w vh-100 bg-black'>
        <Link to="/main" href='' className='ms-2'>Sign in</Link>
    </div>

    <Routes>
    <Route path="/" element={<Login/>}></Route>
    <Route path="/signup" element={<Signup/>}></Route>
        <Route path="/main" element={<RequireAuth><Main/></RequireAuth>}></Route>
</Routes>

</>

  );
}

export default Main;
